import React from "react";
import {Fullscreen} from "@mui/icons-material";

const Work = () => {
	return (
		<>
			<section className="work">
				<div className="heading">
					<h3>My WORKS</h3>
					<h1>Some of my competeid works</h1>
				</div>
				<div className="content">
					{
						Data.map((val) => {
							return (
								<>
									<div className="box">
										<div className="img">
											<img src={val.cover} alt=""/>
										</div>
										<div className="overlay">
											<div className="text">
												<h2>{val.title}</h2>
												<p>{val.desc}</p>
											</div>
											<div className="icon">
												<Fullscreen className="iconWork"/>
											</div>
										</div>
									</div>
								</>
							);
						})
					}
				</div>
			</section>
		</>
	);
};

export default Work;
